import styled from 'styled-components';


const CollectionItemContainer = styled.div`
    width:22vw;
    display: flex;
    flex-direction:column;
    height:350px;
    align-items: center;
    position: relative;

    &:hover{
        .image{
        opacity: 0.8;
        }
        button{
            display: flex;
            opacity: 0.85;
        } 
`;
